import classes from "./Skills.module.css";
import Button from "react-bootstrap/Button";

const Skills = () => {
  return (
    <div className="container">
      <table className="container">
        <tr>
          <td>Javascript</td>
          <td>Reactjs</td>
          <td>HTML</td>
          <td>CSS</td>
          <td>GIT</td>
          <td>JSON</td>
          <td>SASS</td>
          <td>Github</td>
          <td>Bootstrap</td>
          <td>Responsive Design</td>
        </tr>
      </table>
      <hr />
    </div>
  );
};

export default Skills;
